import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../context/AuthContext';
import './Naglowek.css';

const Naglowek = () => {
  const { user, logout } = useContext(AuthContext);

  return (
    <nav className="nav-bar">
      <div className="logo">Braid Hair Glamour</div>
      <ul className="nav-links">
        {user ? (
          <>
            <li><Link to="/konto">Konto</Link></li>
            <li><Link to="/rezerwacje">Zarezerwuj wizytę</Link></li>
            <li><Link to="/wiadomosci">Wiadomości</Link></li>
            <li><button onClick={logout}>Wyloguj się</button></li>
          </>
        ) : (
          <li><Link to="/">Logowanie/Rejestracja</Link></li>
        )}
      </ul>
    </nav>
  );
};

export default Naglowek;
